import React from 'react';
import styled from 'styled-components';
import { Helmet } from 'react-helmet';

const Container = styled.div`
  max-width: 900px;
  margin: 0 auto;
  padding: 80px 16px;
  text-align: center;
`;

const Title = styled.h1`
  margin-bottom: 2rem;
`;

const PlaceholderText = styled.p`
  color: ${({ theme }) => theme.colors.textLight};
  font-size: 1.2rem;
`;

const LiturgiaDiaria = () => (
  <Container>
    <Helmet>
      <title>Liturgia Diária - Apenas um Católico</title>
      <meta name="description" content="Acompanhe a Liturgia Diária da Igreja Católica." />
    </Helmet>
    <Title>Liturgia Diária</Title>
    <PlaceholderText>
      O nosso querido católico está trabalhando nisso ainda.
      <br />
      Em breve, você encontrará aqui as leituras e o evangelho do dia.
    </PlaceholderText>
  </Container>
);

export default LiturgiaDiaria;
